import Food from "./images/restaurantfood.jpg";

function CallToAction(){
    return(
        <section className="CallToAction">
            <div>
                <h1>Little Lemon</h1>
                <h2>Chicago</h2>
                <div>We are a family owned Mediterranean restaurant, focused on traditional recipes served with a modern twist.</div>
                <button>Reserve a Table</button>
            </div>
            <img id="food" src={Food}/>
        </section>
    );
}

export default CallToAction;
